const refImageInput = document.getElementById('nguyen-ref-image');
const clothImageInput = document.getElementById('nguyen-cloth-image');
const resultImage = document.getElementById('nguyen-result-image');
const tryOnImages = {}

function uploadReferenceImage(id) {
    const imageInput = document.getElementById(id);
    imageInput.click();
}

function uploadReferenceImageInternal(element, imgID) {
    const refImage = document.getElementById(imgID);
    const file = element.files[0];
    const imageType = /image.*/;

    if (file.type.match(imageType)) {
        const reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onloadend = () => {
            refImage.src = reader.result;
        }
    } else {
        window.alert('Invalid image file.');
    }
}

function tryOn() {
    let response = getFakeTryOnAPI();

    if (response["message"] == "success") {
        resultImage.src = response["result"];
    }
}

function getFakeTryOnAPI() {
    return {
        "message": "success",
        "result": "data:image/jpeg;base64,"
    }
}